import { useEffect } from "react"
import { useState } from "react"
import { useNavigate } from "react-router"  
import CART from "../Cart/cart"
function Products() {

    const [count, setCount] = useState(0)
    const [items ,setItems] = useState([])

    const navigate = useNavigate()

    const addCount = () => {
        setCount(count + 1)
    }
    const removeCount = () => {
        if(count!==0){
            setCount(count - 1)
        }
    }

    let products = [
        { id: 1,image :"data:image/jpeg;base64,", name: "IPhone", price: 10000 },
        { id: 2,image :"data:image/jpeg;base64,", name: "Laptop", price: 20000 },
        { id: 3,image :"data:image/jpeg;base64,", name: "Head Phone", price: 3000 },
        { id: 4,image :"data:image/jpeg;base64,", name: "Mouse", price: 1000 },
        { id: 5,image :"data:image/jpeg;base64,", name: "Key Board", price: 1000 },
        {id:6 , name:"Samsung Phone", price:16000, image:"data:image/jpeg;base64,"},
        {id:7 , name:"Pulsar NS200", price:200000, image:"data:image/jpeg;base64,"},
        {id:8 , name:"XL Super", price:40000, image:"https://4.imimg.com/data4/ND/MR/GLADMIN-3567196/2-500x500.jpg"},
        {id:9 , name:"Boat Bluetooth", price:2000, image:"data:image/jpeg;base64,"},
        {id:10 , name:"JBL Bluetooth", price:3000, image:"data:image/jpeg;base64,"},
        {id:11 , name:"Nike Shoes", price:5000, image:"data:image/jpeg;base64,"},
        {id:12 , name:"Puma Shoes", price:4000, image:"data:image/jpeg;base64,"},
        {id:13 , name:"Adidas Shoes", price:5000, image:"data:image/jpeg;base64,"}, 
        ]

    let originalProducts = [...products]

    const Search = (event) => {
        let value = event.target.value
        let filterProducts = originalProducts.filter(product => product.name.toLowerCase().includes(value.toLowerCase()))
        products = filterProducts
        setItems(products)
        console.log(products)
    }

    const handleLogout = () => {
        localStorage.clear()
        navigate('/')
    }

     useEffect(()=>{
        setItems(products)
        console.log(products)
    },[])   


    return (
        <div>
            <CART count={count} />
            <div style={{ border: "5px solid black", width: "1325px", margin: "5px", padding: "5px" }}>
                <h1><u>Products Page</u></h1>

                <input style={{ border: "3px solid black",height :"20px" , width: "300px", margin: "5px", padding: "5px" }} placeholder="Search Product Name" onChange={Search}></input><br /><br />
                {
                    items.map(product => (
                        <div key={product.id} style={{ borderRadius: "10px", border: "5px solid black", width: "300px", margin: "5px", padding: "5px" ,display:"inline-block" }}>
                            <img src={product.image} alt={product.name} width="200px" height="200px" /><br />
                            <h3>ID : {product.id}</h3>
                            <h3>PRODUCT NAME :{product.name}</h3>
                            <h3>PRICE: Rs.{product.price}</h3>
                            <button onClick={addCount}>ADD TO CART</button><br/><br/>
                            <button onClick={removeCount}>REMOVE FROM CART</button>
                        </div>
                    ))
                }
                
            </div>
            <button onClick={handleLogout}>LOGOUT</button>
        </div>
    )
}


export default Products